  `gift` text COMMENT '赠品内容，针对业务员给医院下单专用列',
  `orderinfo` text COMMENT '订单所有商品列,json串保存，json串包含字段：商品名，规格，单价，单位，数量',
  `accountstatus` int(1) DEFAULT '0' COMMENT '登账状态',
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1343 DEFAULT CHARSET=utf8mb4 COMMENT='订单主表';

